@Dhole, EnderKid2; Not sure what to say about the leg; All my attempts so far to determine what is wrong with the model and/or the config haven't  yielded any successful results. To the best I can determine, information on making legs in 1.1.3 is practically non-existant, and the scraps of information available I used to get them working in 1.1.2 apparently are no longer valid, so it's a long, slow, soul-crushing process of trial and error at this point. I'll keep working at getting them fixed, but I don't know when or how long it will take at this point.

@Gatnerd: CRP dependent stuff: Mk2Expansion/Engines/AASRB, Mk2Expansion/Engines/Augmented Rocket, Mk2Expansion/Engines/Rontgen, Mk2Expansion/Utility/Reactor, Mk2Expansion/Patches/Mk2X\_AtmIntake.cfg. The only CRP resources used are IntakeAtm, EnrichedUranium, and DepletedFuel, so you could either cull the above, or copy those three resources into the Mk2Expansion/Resources/resources.cfg and delete CRP without issue from Mk2Expansion.

@precision77: If you have Kerbal Atomics installed but want <abbr title="Liquid Fuel">LF</abbr> for the Pluto, delete the Mk2Expansion/Patches/M2X\_KA.cfg

[@DaMachinator](https://forum.kerbalspaceprogram.com/index.php?/profile/164681-damachinator/):Looking at a 1.05 DRE release and comparing its part config <abbr title="Module Manager (mod)">MM</abbr> and the M2X one, it looks like SkinMaxTemp should be outside ModuleAeroReentry; best guess is something changed in DRE configs between 1.04 and 1.05 and I either forgot or overlooked the change when updating M2X to 1.05. Deleting the contents of Mk2Expansion/Patches/Mk2X\_DRE.cfg and replacing it with the code below should should bring M2X parts inline with 1.05 DRE temp values and fix the skintemp problem.

Spoiler

@PART[M2X_DropshipCockpit|BladeCockpit|RavenCockpit|M2X_ViperCockpit|mk2_HypersonicNose|TunaCockpit|mk2_InlineIntake|mk2EngineShroud|mk2_MantaIntake|M2X_SmallLab|mk2InverterFuselage|mk2_SupersonicNose|mk2_SpadeTail|mk2Decoupler|Mk2THub|Mk2XHub|Mk2ShieldedDockingPort|mk2_OMSpod|mk22X5WayRCS|mk25WayRCS|mk2RCRCS|mk2PGRCS|mk2FF5WayRCS|mk2SCRCS|mk2Servicebay|mk2_AeroIntake|ChineCap|ChineLong|RootChineAdapter|RootChineLong|RootChineShort|ChineShort|Mk1Chinecap|Mk1ChineLong|Mk1ChineShort|mk2UST|mk2625tricoupler|M2X_Tailboom|M2X_Reactor|M2X_Shortbicoupler|M2X_Short25adapter|M2X_Shockcone|M2X_RadialLeg|M2X_DeployablePanel|M2X_Endcap|M2X_Precooler]:NEEDS[DeadlyReentry]:FOR[Mk2Expansion]
    {@maxTemp = 850@emissiveConstant = 0.85@thermalMassModifier = 1%skinMaxTemp = 2706%skinThermalMassModifier = 0.436%skinInternalConductionMult = 0.0000105%skinMassPerArea = 0.815MODULE{	name = ModuleAeroReentry}
    }

@umaxtu: The Sledgehammer is an Air-Augmented Rocket Engine, all the airbreathing mode does is turn the engine from a rocket to a rocket powered ramjet for improved thrust and <abbr title="Specific Impulse (rocketry) or Internet Service Provider">ISP</abbr>; it's still burning <abbr title="Liquid Fuel">LF</abbr>/O either way.  

The lift fans use <abbr title="Liquid Fuel">LF</abbr>/O because they were intended to be able to function in any atmosphere, not just Kerbin/Laythe, which means basically a choice between either Ec (which means a massive amount of batteries, RTGs, or OX-STAT static solar panels) or <abbr title="Liquid Fuel">LF</abbr>/O (convenient tankage options that the airframe probably incorporates as part of the overall design anyway), so I went with <abbr title="Liquid Fuel">LF</abbr>/O. The latest update also adds an airbreathing option.

@knotty: I'd rather not, for every person who wants to fool around with it, there are probably 3-4 people who just want to have a leg for a Base or whatever and don't want their craft flipping out and exploding because the leg is possessed by the Kraken. If you really want to have the leg, just grab it from M2X 1.7.12 at Mk2Expansion/Parts/Utility/LandingLeg.
